@Ivan Korystin  well it's not the population as in just the number of people it is the system that feeds off the energy which we also need. None of you even know about the system that controls you but we are at war with it. 

Soon it will have the power to force us to comply with anything it wants. Without the system, we would be free. We would thrive in smaller communities cut off from the chaos of one world. 

The system needs us all distracted and hating each other. It needs us divided by all costs or it can't succeed. Fear is its weapon of control. Fear not
